INSERT INTO `Gene_2` (`Gene`, `Accession`, `Gene_Function`, `Non_Translated_RNA_Sequence`) VALUES
('Orf1ab', 'BCB15089.1 or BCB97900.1', 'ORF1ab polyprotein, the largest gene, contains overlapping open reading frames that encode polyproteins PP1ab and PP1a. Nonstructural proteins are responsible for viral transcription, replication, proteolytic processing, suppression of host immune responses and suppression of host gene expression.', 'Beginning-ORF1ab (1–265):                                                                        1 auuaaagguu uauaccuucc cagguaacaa accaaccaac uuucgaucuc uuguagaucu.                                                                                                 61 guucucuaaa cgaacuuuaa aaucugugug gcugucacuc ggcugcaugc uuagugcacu.                                                                                              121 cacgcaguau aauuaauaac uaauuacugu cguugacagg acacgaguaa cucgucuauc.                                                                                               181 uucugcaggc ugcuuacggu uucguccgug uugcagccga ucaucagcac aucuagguuu                                                                                               241 cguccgggug ugaccgaaag guaag'),
('ORF1a', 'YP_009725295.1', 'The start and end position of ORF1a are 266-13483. The ORF1a produces a polypeptide pp1a, which proteolytically cleaved to produce 10nsps while the -1PRF of SARS-CoV-2 allows continued translation till ORF1b and yields a larger polypeptide (pp1ab) which gets cleaved into 16 nsps. The pp1a and pp1ab protein undergoes autoproteolytic cleavage to form the viral replication complex', ''),
('S Gene', 'BCA87361.1', 'This glycoprotein mediates attachment of the virus particle and entry into the host cell. S protein is an important target for vaccine development, antibody therapies and diagnostic antigen-based tests', 'ORF1ab-ORF2 (21,556–21,562: 1 acgaaca'),
('ORF3a', 'BCA87362.1', 'ORF3a encodes a viral accessory protein. Based on its similarity to other coronavirus proteins, ORF3a protein is thought to be a protein with ion channel activity (viroporin) that activates the NLRP3 inflammasome. ORF3a may also play a role in virus replication and pathogenesis', 'ORF2-ORF3a (25,385–25,392): 1 acgaacuu'),
('E Gene', 'BCA87363.1', 'This protein facilitates assembly and release of the virus and has ion channel activity required for pathogenesis', 'ORF3a-ORF4 (26,221–26,244)'),
('M Gene', 'BCA87364.1', 'M protein antagonizes type I and III IFN production by targeting RIG-I/MDA-5 signaling, which subsequently attenuates antiviral immunity and enhances viral replication', 'ORF4-ORF5 (26,473–26,522): 1 acgaacuaaa uauuauauua guuuuucugu uuggaacuuu aauuuuagcc'),
('ORF6a', 'BCA87365.1', 'ORF6 encodes a viral accessory protein. Based on its similarity to other coronavirus proteins, ORF6 protein is thought to play a role in viral pathogenesis', 'ORF5-ORF6 (27,192–27,201): 1 gugacaacag'),
('ORF7a', 'BCA87366.1', 'ORF7a encodes a viral accessory protein. ORF7a protein is thought to be a type I transmembrane protein', 'ORF6-ORF7a (27,388–27,393): 	1 acgaac'),
('ORF7b', 'BCB15096.1', 'ORF7b encodes a viral accessory protein. ORF7b protein is thought to localize to the Golgi compartment.', 'ORF7b-ORF8 (27,888–27,893): 1 acgaac'),
('ORF8', 'BCA87367.1', 'ORF8 is highly variable and showing structural changes suspected to be related with the virus ability to spread. viral ORF6, ORF8 and nucleocapsid proteins were potential inhibitors of type I interferon signaling pathway', 'ORF8-ORF9 (28,260–28,273): 1 acgaacaaac uaaa'),
('N Gene', 'BCA87368.1', 'The nucleocapsid phosphoprotein is a structural protein that binds to, protects the viral RNA genome and is involved in packaging the RNA into virus particles. The N protein has been suggested as an antiviral drug target', 'ORF9-ORF10 (29,534–29,557): 1 acucaugcag accacacaag gcag'),
('ORF10', 'BCA87369.1', 'ORF10 encodes a potential viral accessory protein', 'ORF10-end (29,675–29,903):                                                                      1 caaucuuuaa ucagugugua acauuaggga ggacuugaaa gagccaccac auuuucaccg \n61 aggccacgcg gaguacgauc gaguguacag ugaacaaugc uagggagagc ugccuauaug\n121 gaagagcccu aauguguaaa auuaauuuua guagugcuau ccccauguga uuuuaauagc\n181 uucuuaggag aaugacaaaa aaaaaaaaaa aaaaaaaaaa aaaaaaaaa');

