INSERT INTO `Protein_1` (`Gene_Num`, `Protein_id`, `Gene`, `Protein`, `Start_aa`, `End_aa`, `Aa_count`, `P_Description`, `P_Function`) VALUES
('1', 'YP_009725297.1 ', 'ORF1ab', 'Nsp1', '1', 180, 180, 'Nsp1 is the N-terminal cleavage product of polyprotein precursors, pp1a and pp1ab, produced through proteolysis by viral papain-like protease (PLpro)', 'Leader protein host translation inhibitor. Mediates RNA replication and processing. Involved in mRNA degradation'),
('1', 'YP_009725298.1 ', 'ORF1ab', 'Nsp2', '181', 818, 638, 'Nsp2 is a replicase product essential for proofreading viral replication', 'Modulation of host cell survival signalling pathway by interacting with host PHB and PHB2'),
('1', 'YP_009725299.1', 'ORF1ab', 'Nsp3', '819', 2763, 1945, 'Nsp3, a multi-domain membrane-bound protein and is the largest protein (1945 amino acid residues) encoded by the coronavirus genome.', 'Functions as a protease to separate the translated polyprotein into its distinct proteins'),
('1', 'YP_009725300.1', 'ORF1ab', 'Nsp4', '2764', 3263, 500, 'A membrane-spanning protein contains transmembrane domain 2 (TM2)', 'Believed to anchor the viral replication-transcription complex to modified ER membranes'),
('1', 'YP_009725301.1', 'ORF1ab', 'Nsp5', '3264', 3569, 306, 'Nsp5 is a 33 kDa, 3C-like protease', 'Involved in viral polyprotein processing during replication'),
('1', 'YP_009742613.1', 'ORF1ab', 'Nsp6', '3570', 3859, 290, 'Putative transmembrane domain', 'Plays a role in the initial induction of autophagosomes from host endoplasmic reticulum'),
('1', 'YP_009725303.1', 'ORF1ab', 'Nsp7', '3860', 3942, 83, 'It forms a hexadecameric super-complex with nsp8 that adopts a hollow cylinder-like structure implicated replication.', ' Nsp7 and Nsp8 along with Nsp12 forms a replicase complex for replication and transcription of the viral RNA genome.'),
('1', 'YP_009725305.1 ', 'ORF1ab', 'Nsp8', '3943', 4140, 198, 'It forms a hexadeca-meric super-complex with nsp7 that adopts a hollow cylinder-like structure implicated replication', ' Nsp7 and Nsp8 along with Nsp12 forms a replicase complex for replication and transcription of the viral RNA genome.'),
('1', 'YP_009725305.1', 'ORF1ab', 'Nsp9', '4141', 4253, 113, 'A single-stranded RNA-binding viral protein. Nsp9 of SARS-CoV-2 shares 97% sequence identity with SARS-CoV ortholog', 'Participate in viral replication by acting as an ssRNA-binding protein'),
('1', 'YP_009725306.1', 'ORF1ab', 'Nsp10', '4254', 4392, 139, 'Nsp10 is single-domain protein having 99% sequence identity with SARS-CoV Nsp10.', 'In viral transcription by stimulating both nsp14 3′-5′ exoribonuclease and nsp16 2′-O-methyltransferase activities. Therefore plays an essential role in viral mRNAs cap methylation'),
('1', 'YP_009725312.1 ', 'ORF1ab', 'Nsp12', '4393', 5324, 932, 'Nsp12 is a 103 kDa multi-subunit RNA-dependent RNA polymerase (RdRp)', 'Responsible for replication and transcription of the viral RNA genome'),
('1', 'YP_009725307.1', 'ORF1ab', 'Nsp13', '5325', 5925, 601, 'Zinc-binding domain, NTPase/helicase domain, RNA 5_-triphosphatase', 'Nsp13 interacts with Nsp8 and Nsp12 with potential implications for helicase activity and regulation and plays an essential role in viral replication and conservation across all CoV species'),
('1', 'YP_009725308.1 ', 'ORF1ab', 'Nsp14', '5926', 6452, 527, 'Nsp14 from coronavirus is a bifunctional protein having an N-terminal exonuclease (ExoN) and a C-terminal guanine-N7 methyl transferase (N7-MTase) domain', 'ExoN domain implicated in proofreading function and N7-MTase domain involved in the methylation of viral RNA cap. The proofreading activity of Nsp14 has been suggested to be responsible for the evolution and maintenance of large genomes of coronavirus. The mRNA capping activity of Nsp14 is important for the stability of viral mRNA by evading its degradation from the host immune response'),
('1', 'YP_009725310.1', 'ORF1ab', 'Nsp15', '6453', 6798, 346, 'EndoRNNsp15 is an endoribonuclease which cleaves RNA specifically at the 3′-end of uridylates. Its endoribonuclease domain is unique to vertebrate-infecting nidovirales, including coronaviruses.', 'The endonuclease activity of Nsp15 helps the virus evade immune system by preventing the detection of viral dsRNA by the host'),
('1', 'YP_009725311.1', 'ORF1ab', 'Nsp16', '6799', 7096, 298, 'The Nsp16 is an m7GpppA (Cap-1)-specific, S-adenosyl methionine (SAM) dependent, nucleoside 2′-O-methyltransferase and catalyzes the 5′-methyl capping of viral mRNA', 'The 5′-methyl capping protects viral RNA from degradation by host 5′-exoribonucleases and serves to evade the induction of innate immune response. Genetic disruption of SARS-CoV Nsp16 leads to a ten-fold reduction in the synthesis of viral RNA'),
('2', 'YP_009724390.1', 'S Gene', 'Surface Glycoprotein', '7098', 8371, 1274, 'The homo-trimeric spike glycoprotein (S protein), protruding from the viral surface, is the first anchoring point of the virus to the host cell', 'Main means of virus entry into host cells. These highly glycosylated proteins protrude from the viral surface to interact with the host cell receptor(s) '),
('3', 'YP_009724391.1', 'ORF3a', 'ORF3a Protein', '8374', 8650, 277, 'The ORF3a is a transmembrane protein of the viroporin family that forms ion channels in the host membrane', 'Forms homotetramers with ion channel properties. Linked to inflammatory, IFN and innate immunity responses, it triggers apoptosis and modulates cell cycle '),
('4', 'YP_009724392.1', 'E Gene', 'Enevelope Protein', '8658', 8734, 77, 'The E protein of SARS-CoV-2 is the smallest transmembrane structural protein of 75 amino acids comprising three domains', 'Minor structural protein that forms pentameric ion channels in host ER membranes. Involved in overexpression of cytokines and exaggerated immune response'),
('5', 'YP_009724393.1', 'M Gene', 'Membrane Glycoprotein', '8751', 8974, 224, 'The SARS-CoV-2 M protein is a 222 amino acid long transmembrane glycoprotein of type III and is the most abundant structural protein', 'Required for membrane curvature initiation, RNA packing, and viral particle budding'),
('6', 'YP_009724394.1', 'ORF6', 'ORF6', '8977', 9039, 63, 'Viral accessory protein', 'ORF6 is able to inhibit STAT1 nuclear translocation to block IFN signaling. It localizes at the nuclear pore complex (NPC) where it binds directly to the Nup98-Rae1 complex to target the nuclear import pathway and mediate this inhibition'),
('4', 'YP_009724395.1', 'ORF7a', 'ORF7a', '9041', 9163, 123, 'The ORF7a encodes a type I transmembrane protein, known as accessory protein 7a, protein U122, or protein X4', 'Prevents virus tethering at the plasma membrane by binding to BTS-2'),
('8', 'YP_009725318.1', 'ORF7b', 'ORF7b', '9162', 9206, 45, 'The ORF7b initiation codon overlaps the ORF7a stop codon in a −1 shifted ORF. We demonstrate that the ORF7b protein is expressed in virus-infected cell lysates and from a cDNA encoding the gene 7 coding region, indicating that the sgRNA7 is bicistronic', 'Integral transmembrane protein. Its function is unclear '),
('9', 'YP_009724396.1', 'ORF8', 'ORF8', '9208', 9330, 123, 'ORF8 is an accessory protein of 121 residues having an N-terminal signal sequence (residues 1–17) for transport to endoplasmic reticulum, and a β-strand core comprising residues 18–121, resembling immunoglobulin (Ig)-like fold', 'Accessory protein involved in enhanced virus replication'),
('10', 'PODTD2', 'ORF9b', 'ORF9b', '0', 0, 1, 'ORF9b, a 97 amino acids long accessory protein, is encoded by an alternative open reading frame within the nucleocapsid gene', 'ORF9b suppresses IFN-I response through association with an adapter protein, TOM70.173 IFN-I has a central role in the immune response against viral infections'),
('11', 'YP_009724397.2', 'N Gene', 'Nucleocapsid Phosphoprotein', '9335', 9754, 420, 'N protein packages the viral RNA into helical ribonucleocapsid (RNP) and interacts with the other structural proteins during virions’ assembly leading to genome encapsidation', 'Packages the viral RNA to form a ribonucleocapsid, playing a key role in viral assembly'),
('12', 'YP_009725255.1', 'ORF10', 'ORF10 Protein', '9763', 9801, 39, 'ORF10 is speculated to encode a 38 aa protein.', 'Accessory protein with potential role in inhibiting the ubiquitin-proteasome system (UPS)');

